import React, { useState } from 'react';

const StuMedicalView = () => {
  const [searchQuery, setSearchQuery] = useState('');
  const [data, setData] = useState([
    { date: '2023-07-01', pdf: 'file1.pdf', reason: 'Document 1', status: 'Approved' },
    { date: '2023-07-02', pdf: 'file2.pdf', reason: 'Document 2', status: 'Pending' },
    { date: '2023-07-03', pdf: 'file3.pdf', reason: 'Document 3', status: 'Rejected' },
  ]);

  const [newEntry, setNewEntry] = useState({ date: '', pdf: '', reason: '', status: '' });

  const handleSearchChange = (event) => {
    setSearchQuery(event.target.value);
  };

  const handleStatusChange = (index, event) => {
    const updatedData = [...data];
    updatedData[index].status = event.target.value;
    setData(updatedData);
  };

  const handleAdd = () => {
    setData([...data, newEntry]);
    setNewEntry({ date: '', pdf: '', reason: '', status: '' });
  };

  const handleInputChange = (event, field) => {
    const value = event.target.value;
    setNewEntry((prevEntry) => ({ ...prevEntry, [field]: value }));
  };

  const filteredData = data.filter((row) => {
    if (row.status.toLowerCase().includes(searchQuery.toLowerCase())) {
      return row;
    }
    return false;
  });

  const tableRows = filteredData.map((row, index) => (
    <tr key={index}>
      <td>{row.date}</td>
      <td>{row.pdf}</td>
      <td>{row.reason}</td>
      <td>
        <select value={row.status} onChange={(event) => handleStatusChange(index, event)}>
          <option value="Pending">Pending</option>
          <option value="Approved">Approved</option>
          <option value="Rejected">Rejected</option>
        </select>
      </td>
    </tr>
  ));

  return (
    <div>
      <div>
        <input type="text" value={searchQuery} onChange={handleSearchChange} placeholder="Search..." />
        <button onClick={handleAdd}>Add</button>
      </div>
      <table>
        <thead>
          <tr>
            <th>Date</th>
            <th>PDF</th>
            <th>Reason</th>
            <th>Status</th>
          </tr>
        </thead>
        <tbody>
          {tableRows}
        </tbody>
      </table>
      <div>
        <input type="text" value={newEntry.date} onChange={(event) => handleInputChange(event, 'date')} placeholder="Date" />
        <input type="text" value={newEntry.pdf} onChange={(event) => handleInputChange(event, 'pdf')} placeholder="PDF" />
        <input type="text" value={newEntry.reason} onChange={(event) => handleInputChange(event, 'reason')} placeholder="Reason" />
        <select value={newEntry.status} onChange={(event) => handleInputChange(event, 'status')}>
          <option value="">Select status</option>
          <option value="Pending">Pending</option>
          <option value="Approved">Approved</option>
          <option value="Rejected">Rejected</option>
        </select>
      </div>
    </div>
  );
};

export default StuMedicalView;
